import { Switch, Route, Routes } from "react-router-dom";
import Main from "../views/Main";
import Quotes from "../views/Quotes";

const AppRoutes = () => {
return (
    <Routes>
        <Route path="/Main" element={<Main  /> } />
        <Route path="/Quotes" element={<Quotes  /> } />
       

    </Routes>
);
}

export default AppRoutes;
